import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li> Name : {Info.name}</li>
      <li> Categories : {Info.categories}</li>
      <li>
        Image:
        <img src={Info.profile_image_url} alt={"logo"} width="250" />
      </li>
      Images:
      {Info.images.forEach((imginfo) => {
        console.log(imginfo);
        <li>
          <img src={imginfo} alt={"logo"} />;
        </li>;
      })}
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li> name{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  console.log();
  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
